import React, { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
// import productsData from "./productsData";

export default  function Products(prop) {
  const [productsData , setProductsData]= useState("");
   axios
    .get(`http://127.0.0.1:8000/product_detail/`)
    .then(res => {
      setProductsData(res.data.data)
       console.log(productsData)
    })
    return(
      <div className="row">
        {
          productsData.map( (e) => {
            return (
              <div className={prop.grid}>
                <div key={e.id} className="product product-10 text-center">
                  <figure className="product-media">
                    <Link to={`/products/${e.id}`}>
                      <img src={e.photo_url} alt={e.title} className="product-image" />
                      <img src={e.photo_url} alt={e.title} className="product-image-hover" />
                    </Link>
                  </figure>
                  <div className="product-body">
                    <div className="product-action">
                      <a href="#" className="btn-cart"><span>add to cart</span></a>
                      <a href="#" className="btn-product-icon btn-wishlist"><span>Add to Wishlist</span></a>
                    </div>
                    <div className="product-intro">
                      <h3 className="product-title">
                        <Link to={`/products/${e.id}`}>
                          {e.title}
                        </Link>
                      </h3>
                      <div className="product-price">${e.actual_price}</div>
                    </div>
                    <div className="product-detail">
                      <div className="ratings-container">
                        <div className="ratings">
                          <div className="ratings-val"></div>
                        </div>
                        <span className="ratings-text">( 6 Reviews )</span>
                      </div>             
                    </div>
                  </div>
                </div>
              </div>
            )
          })
        }
      </div>
    );
}
